import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [animalCounts, setAnimalCounts] = useState({});

  useEffect(() => {
    const fetchCounts = async () => {
      try {
        const response = await axios.get('http://localhost:5000/animal_counts');
        setAnimalCounts(response.data);
      } catch (error) {
        console.error('Error fetching animal counts:', error);
      }
    };

    fetchCounts(); // Initial fetch
    const interval = setInterval(fetchCounts, 5000); // Update every 5 seconds

    return () => clearInterval(interval); // Cleanup on component unmount
  }, []);

  return (
    <div className="App">
      <h1>Real-time Object Detection</h1>
      <div>
        <img src="http://localhost:5000/video_feed" alt="Video Feed" style={{ width: '80%', height: 'auto' }} />
      </div>
      <div id="counts" style={{ marginTop: '20px' }}>
        <h2>Animal Counts:</h2>
        <pre>{JSON.stringify(animalCounts, null, 2)}</pre>
      </div>
    </div>
  );
}

export default App;
